import React,{Component}from 'react';
import axios from 'axios';
import RequestRow from "../components/RequestRow.component"

export default class ArcitectPage extends Component{
    constructor(props){
        super(props);
        
        this.state={Requests:[]};
    }
    componentDidMount(){
      //${this.props.userID}
        axios.get(`http://localhost:3000/Request/Userid/${this.props.User._id}`)
        .then(res=>{
         this.setState({Requests:res.data})})
        .catch(err=>{console.log('Error'+err)})
    }

    RequestsList(){
      console.log(this.state.Requests[0])
        return this.state.Requests.map( currentRequests=>{
            return(
            <div className="col-md-3">
            <RequestRow
            Username={currentRequests.username}  email={currentRequests.email}
            SVM={currentRequests.SVM} File={currentRequests.File}
            id={currentRequests._id}
            key={currentRequests._id}/>
            </div>)
        })
    }
    render(){
        console.log(this.props.User)
        return(
        <div>
            <div className="container-fluid d-flex justify-content-center">
              <div className="row">
                  {this.RequestsList()}
              </div>
            </div>
        </div>
        )
    }
}
